('sql', "```sql
-- 입력 파라미터 정의
CREATE OR REPLACE PROCEDURE print_numbers(
  a INT,
  b INT
) AS
BEGIN
  -- 출력 문자열 생성
  DECLARE result TEXT DEFAULT '';
  SET result = CONCAT(a, ' ', b);

  -- 출력
  SELECT result;
END;

-- 프로시저 호출
CALL print_numbers(1, 2);
```")

